message:
Vou te contar um historia de um  homen que desceu ao inferno quando ele faz um pacto com o diabo...
@NandoHFAPC 

Por gentileza tem como você falar um pouco sobre as celas no inferno  das mães que abortam.

Galera, antes e de ir lavar a louça, deixo-vos meu raciocinio sobre essa conspiração:
1 - Dia 30, 19:30, Bonner oficializa o candidato da esquerda eleito, confirmando que não soltaram o ladrão para concorrer a eleição à toa;
2 - Bolsonaro não se manifesta;
3 - População sai às ruas contra os resultados;
4 - Esquerda manda os bandidtos pras ruas para criar o caos;
5 - Exército entra em ação. Puplica relatório de fraude nas urnas e prende seu líder (cabeça de ovo);
6 - Resultados oficiais sem fraude são divulgados.
7 - Bolsonaro é oficialmente reeleito.

Observem que, nesse cenário, para não haver derramamento de sangue, e nem intervenção militar, demanda sacrifícios (prisões de engodos). Sacrifícios são as formas mais tradicionais de conter os ânimos da população. Degolas levam a mais degolas e o processo fica cada vez mais difícil de ser contido. Por isso, acho que se o dinheiro dado não for muito ao lado contrário, o dono das "caixas de pandora" deixará os resultados correrem normalmente sem interferência nenhuma dessa vez.

Outra possibilidade, improvável considerando o número de representantes do exército ao lado do presidente do último 7 de setembro, é as forças armadas estarem fechadas com os planos comunistas, terem pago mais, terem rabo preso, deverem favores etc. Acho que não.

Bodes. Como já falei acima, são e foram os principais a apoiar o presidente Bolsonaro até aqui. Querem voltar a liderar essa fase final para colher os frutos merecidos desse apoio. Continuarão a apoiá-lo.
